            <p>I think <span style={{color: "#555555"}}>{Props.children}</span></p>
    <p>We have experts for working on this technologies like <span style={{color: "red"}}> {expertState.techExperts[1].name} </span> having <span style={{color: "red"}}> {techExperts[1].experiance}</span> of experiance</p>
        </div>
    );
}

